import React from "react";
import Dashboard from "./Dashboard";

const Home = (props) => {

    const userLoggedIn = useSelector(state=>state.appData.isLoggedIn)

    return (
        <div>
            {userLoggedIn?
            <Dashboard/>
            :
            <div></div>
        }
        </div>
    )
}

export default Home
